subproject.description:
The project will establish a value chain linking up farmers, the farmers’ associations, food processing facilities and service providers with each other, and strengthening their capacity thorough trainings, extension support and access to markets. 
The project includes three components:
1/ Consulting service to farmers to increase yield and productivity;
 2/ Demonstration projects in food processing and preservation;
 3/ Improved access to agriculture market through harvest consolidation.
